import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import './home.js';


ReactDOM.render(
  <React.StrictMode>
    <App>
      <Switch>
        <Route path= "/home" component={Home}/>
      </Switch>
    </App>
  </React.StrictMode>,
  document.getElementById('root')
);
